Game Description
Shape shifting evil lurks and lives in the dark house within the gloomy forest. Take shelter here if you must, but beware of the threats that lie in wait in The Spell, a gothic match 3 adventure that will keep you on your toes.

When you and your friend seek refuge from a raging storm while hiking in a tangled forest, you come across what seems to be your only choice for cover. You soon encounter the cruel witch who inhabits this haunted house and you are faced with protecting your very soul. Can you save your friend who's been frozen in stone?
